import { View, TouchableOpacity, Linking, Text } from "react-native";
import Ionicons from "react-native-vector-icons/Ionicons";

export default function useCustomHeader() {
  return (
    <View
      style={{
        flexDirection: "row",
      }}
    >
      <TouchableOpacity
        style={{
          backgroundColor: "#F1F2F4",
          borderRadius: 100,
          padding: 5,
          width: 110,
          alignItems: "center",
          justifyContent: "center",
          flexDirection: "row",
        }}
        onPress={() => Linking.openURL("content://com.android.calendar/time/")}
      >
        <Ionicons name="ios-calendar-outline" size={20} />
        <Text style={{ marginLeft: 5 }}>Calendar</Text>
      </TouchableOpacity>
    </View>
  );
}
